import React from "react";

import Link from "next/link";
import { BrowserRouter as Router, Route } from "react-router-dom";

const Test = () => {
  return <p>Hello</p>;
};

const Index = () => {
  return (
    <div>
      <Link href="/aa">dd</Link>
      <Router>
        <Route path="aa" component={Test} />
      </Router>
    </div>
  );
};

export default Index;
